    var xdomain = d3.extent(data.x);
    var ydomain = d3.extent(data.y);
    var zdomain = d3.extent(
      [].concat.apply([], data.z).filter((f) => {
        return !isNaN(parseFloat(f)) && isFinite(f);
      })
    );
  
